import React from "react";
const Checkbox = ({question, onChange, onBlur}) => {
    return (
        <div>
            <label>
                <input
                    type="checkbox"
                    value={question.value}
                    defaultChecked={question.value}
                    onChange={onChange}
                    onBlur={onBlur}/>
                {question.label}
            </label>
            {question.error && <span>{question.error}</span>}
        </div>
    )
};

export default Checkbox;
